import "./rightbar.css"

export default function Rightbar() {
  return (
    <div className="rightbar">
      <div className="rightbarWrapper">
          <div className="birthdayContainer">
            <img className="birthdayImage" src="/assets/gift.png" alt="" />
          </div>
      </div>
    </div>
  )
}
